package com.tahayunus.wordleedit.data;
public class Data {
    public static int getWordLength() {
        return WORD_LENGTH;
    }

    public static String getWordList() {
        return wordList;
    }

    public static int getWordListSize() {
        return wordListSize;
    }

    static public int WORD_LENGTH = 5;
    static private String wordList = "";
    static private int wordListSize = wordList.length() / WORD_LENGTH;

}
